import React from 'react';

function HomePage({ history }) {
  const goToPreviousPage = () => {
    history.push('/');
  };

  return (
    <div>
      <h2>Home Page</h2>
      <button onClick={goToPreviousPage}>Go to Page 1</button>
    </div>
  );
}

export default HomePage;
